import { createSlice } from '@reduxjs/toolkit';
import axios from 'axios';

export const dataSlice = createSlice({
    name: 'data',
    initialState: {
        fish: [],
      //  bugs: [],
      //  seaCreatures: []
    },
    reducers: {
        setFishData: (state) => {
            const fishURL = 'https://acnhapi.com/v1/fish';
            const fishReq = axios.get(fishURL);
            fishReq.then(res => {
                console.log(res);
                state.fish = res.data;
            });
        },
        getFishData: (state) => {
            return state.fish
        },
